import React from 'react'

export default function Interests() {
    return (
        <div className="interests">
            <h2 className="interests-header">Interests</h2>
            <p className="bg-color interests-text">I love playing and guitar, singing, and looping in live gigs. I also play a mean game of poker.</p>
        </div>

    )
}
